import React, { useState } from 'react';
import './App.css';

const allImages = [
  { src: "data:image/jpeg;base64,", category: "nature" },
  { src: "data:image/jpeg;base64,", category: "city" },
  { src: "data:image/jpeg;base64,", category: "nature" },
  { src: "data:image/jpeg;base64,", category: "city" },
  { src: "data:image/jpeg;base64,", category: "nature" },
  { src: "data:image/jpeg;base64,", category: "city" },
  { src: "data:image/jpeg;base64,", category: "nature" },
  { src: "data:image/jpeg;base64,", category: "city" },
  { src: "data:image/jpeg;base64,", category: "nature" },
  { src: "data:image/jpeg;base64,", category: "city" },
  { src: "data:image/jpeg;base64,", category: "nature" },
  { src: "data:image/jpeg;base64,", category: "city" }
  
 
];

function App() {
  const [selectedImage, setSelectedImage] = useState(allImages[0].src);
  const [selectedIndex, setSelectedIndex] = useState(0);
  const [filter, setFilter] = useState("all");

  const handleClick = (image, index) => {
    setSelectedImage(image);
    setSelectedIndex(index);
  };

  const handleFilterChange = (filter) => {
    setFilter(filter);
    setSelectedImage(allImages[0].src); // reset to first image when filter changes
    setSelectedIndex(0);
  };

  const filteredImages = filter === "all"
    ? allImages
    : allImages.filter(image => image.category === filter);

  return (
    <div className="App">
      <h1>Image Viewer</h1>

      {/* Filter Buttons */}
      <div className="filters">
        <button onClick={() => handleFilterChange("all")}>Do not filter</button>
        <button onClick={() => handleFilterChange("nature")}>Nature</button>
        <button onClick={() => handleFilterChange("city")}>City</button>
      </div>

      {/* Selected Image */}
      <div className="viewer">
        <img src={selectedImage} alt="Selected" className="selected-image" />
        <div className="image-count">
          {selectedIndex + 1}/{filteredImages.length}
        </div>
      </div>

      {/* Thumbnail Gallery */}
      <div className="thumbnail-gallery">
        {filteredImages.map((image, index) => (
          <img
            key={index}
            src={image.src}
            alt={`Thumbnail ${index + 1}`}
            onClick={() => handleClick(image.src, index)}
            className={`thumbnail ${selectedImage === image.src ? 'active' : ''}`}
          />
        ))}
      </div>
    </div>
  );
}

export default App;
